     */
    return {
        setSplashScreenVisibility,
        $scaleForm,
        $currentPage,
        $currentProgress,
        formReset,
        $currentQuestion,
        formPageChanged,
        $currentValue,
        directionChanged,
        $isSplashScreenVisible,
        scaleFormFieldChanged,
        $questions,
        TestGate,
    };
});

